import React from 'react';
import '../App.css';

function Header(){
    return (
        <header id="header-wrap">
            <nav className="navbar navbar-expand-md bg-inverse top-nav-collapse">
                <div className="container">
                </div>
            </nav>
        </header>
        )
}

export default Header
